import React, { useState } from 'react';
import { animated, useSpring, config } from 'react-spring';
import Logo from "../../assets/Logo.png";
import Logo2 from "../../assets/logo-2.png";
import Globe from "../../assets/globe.svg";
import Search from "../../assets/loupe.svg";
import {Link} from "react-router-dom";
import {useDispatch, useSelector} from "react-redux";
import { logoutUser } from "../../actions/authActions";

const SecondNavBar = () => {
  const [active, setActive] = useState('Home');
  const [open, setOpen] = useState(false);

  const props = useSpring({
    opacity: open ? 1 : 0,
    zIndex: open ? 1 : -1,
    minHeight: open ? '50%' : '0%',
    config: { ...config.molasses, duration: 450 },
  });

  const dispatch = useDispatch();

  const {auth} = useSelector(state => state.auth);


  const handleLogOut = (event) => {
      event.preventDefault();
      dispatch(logoutUser());

  };

  return (
    <div className='sticky'>
      <header className='header'>
          <a href="/"><img src={Logo} className= "logo" alt="logo"/></a>
        <nav>
          <ul className='nav-links'>
            <li className='nav-item'>
              <Link
                to='/home'
                onClick={() => setActive('home')}
                className={active === 'home' ? 'active' : null}
              >
                HOME
              </Link>
            </li>
            <li className='nav-item'>
              <Link
                to='/help'
                onClick={() => setActive('help')}
                className={active === 'help' ? 'active' : null}
              >
                HELP
              </Link>
            </li>
            <li className='nav-item'>
              <Link
                to='/settings'
                onClick={() => setActive('settings')}
                className={active === 'settings' ? 'active' : null}
              >
                SETTINGS
              </Link>
            </li>
            <li className='nav-item cont'>
              <Link
                to='/'
                onClick={handleLogOut}
                className={active === '' ? 'active' : null}
              >
                SIGN OUT
              </Link>
            </li>

          </ul>
          <div onClick={() => setOpen(!open)} className='hamburger'>
            <div className={open ? 'hamburger-icon none' : 'hamburger-icon'}>
              <span className="cross"></span>
              <span className="cross"></span>
            </div>
          </div>
        </nav>
        <animated.div style={props} className='menubar'>
          <ul className='menu-links'>
            <li className='nav-item dropped'>
              <Link
                to='/home'
                onClick={() => setActive('home')}
                className={active === 'home' ? 'active' : null}
              >
                HOME
              </Link>
            </li>
            <li className='nav-item dropped'>
              <Link
                to='/help'
                onClick={() => setActive('help')}
                className={active === 'help' ? 'active' : null}
              >
                HELP
              </Link>
            </li>
            <li className='nav-item dropped'>
              <Link
                to='/settings'
                onClick={() => setActive('settings')}
                className={active === 'settings' ? 'active' : null}
              >
                SETTINGS
              </Link>
            </li>
            <li className='nav-item dropped'>
              <Link
                to='/'
                onClick={handleLogOut}
                className={active === '' ? 'active' : null}
              >
                SIGN OUT
              </Link>
            </li>

          </ul>
        </animated.div>
        <a href="https://www.google.com/search?q=cityrunner+delivery+Nigeria&sxsrf=ALeKk03Gi0gL_zn6E5geBZHV_BZENyIkTQ:1608248449939&source=lnms&sa=X&ved=0ahUKEwizm8asmNbtAhVPTcAKHbEBDdsQ_AUIDigA&biw=1280&bih=721&dpr=2"><img src={Search} alt="search" className="nav-icon-1"/></a>
       <a href="https://www.google.com/search?q=cityrunner+delivery+Nigeria&sxsrf=ALeKk03Gi0gL_zn6E5geBZHV_BZENyIkTQ:1608248449939&source=lnms&sa=X&ved=0ahUKEwizm8asmNbtAhVPTcAKHbEBDdsQ_AUIDigA&biw=1280&bih=721&dpr=2"><img src={Globe} alt="globe" className="nav-icon-2"/></a> 
      </header>
      <div className="below-header">
      <p className="below-p">nav</p>
      </div>
    </div>
  );
};

export default SecondNavBar;
